import { FaBars } from "react-icons/fa";
import { NavLink } from "react-router-dom";
function ProductAddImage() {
  return (
    <div className="grid place-items-center my-5 ">
      <div className="max-w-[30rem] w-full p-4">
        <div className="flex justify-end">
          <FaBars className="text-xl" />
        </div>
        <div className="flex flex-col justify-center items-center mt-28">
          {/* 
      ///////////Add Image////////
      ////////////////////////// */}
          <div className="grid place-content-center w-40 h-40 bg-[#D9D9D9] rounded-full">
            <span className="text-3xl font-normal w-14 text-center leading-8">
              Add IMAGE
            </span>
          </div>
          {/* 
      ///////////Product Description////////
      ////////////////////////// */}
          <div className="flex flex-col justify-center items-center">
            <p className="text-[#3B2B2F] text-6xl text-center">DOJA - C99</p>
            <p className="text-[#3B2B2F] text-2xl font-normal -mt-3 text-center">
              LOT:2202010809
            </p>
          </div>

          {/* 
      ///////////Button////////
      ////////////////////////// */}
          <NavLink
            to={"../add-another-image"}
            type="button"
            className="w-full py-3 bg-[#A7AE45] text-[#fff] rounded-xl text-2xl font-bold font-family text-center cursor-pointer] mt-4"
          >
            Next
          </NavLink>
        </div>
      </div>
    </div>
  );
}

export default ProductAddImage;
